var hero = {
	init: function($el){
		this.$el = $el;
		this.startOwl();
	},

	startOwl: function(){
		this.$el.owlCarousel({
			navigation : true,
			singleItem : true,
			navigationText : false,
			mouseDrag :  false,
			autoPlay :   3000,
			stopOnHover : true,
			transitionStyle : "goDown"
		});
	}
};
var open = {
	init: function($el){
		this.$el = $el;
		this.openBox();
	},

	openBox: function(){
		$('.cart').on('click', '.ini', function(e){
			$(e.delegateTarget).addClass('big');
		});
	}
};
